import { Link } from "react-router-dom"
import Img from '../Images/TrakLabs Logo.png'
import '../App.css';

const Navigation = () =>{
    return (
        <div className="NavbarDiv">
        <Link to='/'><img src={Img} alt='TrakLabs Logo'></img></Link>
        <Link to='/employee'><button style={{margin:'10px', fontFamily:'sans-serif'}}>Employee</button></Link>
        <Link to='/department'><button style={{margin:'10px', borderRadius:'10px'}}>Department</button></Link>
        </div>
    );
}

export default Navigation;
